import "../meio/meio.css";
import "./janela";
import Janela from "./janela";

function Meio({ dados }) {
  if (!dados) {
    return <div></div>;
  }

  return (
    <div className="meio">
      <Janela>
        <pre>{JSON.stringify(dados, null, 2)}</pre>
      </Janela>
    </div>
  );
}

export default Meio;
